import React from 'react';
import styled from 'styled-components';

const Value = (props) => {

    const Wrapper = styled.div`
        display: flex;
        flex-direction: column;
        padding: 50px;
        background-color: rgba(0,0,0,0.5);
        @media (max-width: 600px) {
            padding: 30px;
        }
    `;

    return(
        <Wrapper> 
            <h1>{props.valueTitle}</h1>
            <p>{props.valueText}</p>
        </ Wrapper>
    );
}

export default Value;
